import React from "react";
import "../pages/pagesCSS/Home.css";

// 1) Show all the Todolist Items.

const Home = () => {
  // show the chosen hospital data :
  return (
    <div className="data">
      <div className="body">
        <div className="title">the hospital Title</div>

        <div className="clinicName"> Clinic Name</div>

        <div className="list-of-drs">List of Dr names + times</div>
      </div>
    </div>
  );
};

export default Home;
